  false,\n\t\"url\": null,\n\t\"notes\": \"Small mammal traps were placed in the Baring
  division and in the Edmunds division of Moosehom National Wildlife Refuge. There
  were a total of 98 traps set for up to six nights. The traps were checked on August
  14, 15, and August 19-22. Over the weekend the traps were closed so that nothing
  could enter the traps. Traps were set ten yards apart. Deer Mice, Meadow Jumping
  Mice, Woodland Jumping Mice, Masked Shrews, Meadow Voles, Short Tailed Shrews, Short
  Tailed Weasels and a Southern Redbacked Vole were the species captured.\",\n\t\"license_title\":
